function App() {
  return (
    <div className="App">
      <Navbar />

        <div className="vertical-center">
            <div className="text-center">
                <div className="container form-center-signin">
                    <form className="form-signin">
                        <img className="mb-4 rounded" src="logo1112.png" alt="" width="72" height="72"></img>
